import React from "react";
import './App.css';

class Users extends React.Component {
	constructor(){
		super();
		this.state = { users: [] };
	}

	componentDidMount() {
		fetch('/api/users')
		.then(response => response.json())
		.then(json => this.setState({users: json.data }));
	}

	render() {
		return (
			<div>
				<h1>Users</h1>
				{
					this.state.users.lenght == 0
					? "Loading users..." : this.state.users.map(user => (
						<figure key={user.id}>
							<figcaption>
								{user.firstName}
							</figcaption>
							<figcaption>
								{user.firstName}
							</figcaption>
							<figcaption>
								{user.lastName}
							</figcaption>
							<figcaption>
								{user.dob}
							</figcaption>
						</figure>
					))
				}
				</div>
		);
	}
}

export default Users;
